INSERT INTO `product` VALUES ('MLA14845068','',_binary '\0','Mouse gamer Multilaser Gamer MO269',111762.26710352964,21),('MLA15698869','RAZER DEATHADDER V2 - ERGONOMÍA SIN IGUAL\n\n• El mejor diseño ergonómico de su clase  \n• Switches ópticos para ratón Razer  \n• Sensor óptico Razer Focus+  \n• Cable Razer Speedflex  \n• Memoria integrada avanzada  \n\nEL MEJOR DISEÑO ERGONÓMICO DE SU CLASE  \nHabiendo vendido más de diez millones de Razer DeathAdder, el ratón para juego más celebrado y premiado del mundo se ha ganado su popularidad por su diseño ergonómico sin igual. Se adapta a la perfección al agarre de palma, así como al agarre en garra y agarre con la punta de los dedos.  \nEl Razer DeathAdder V2 mantiene la forma característica a la vez que aligera su peso para un manejo más rápido y mejorado de tu juego. Este diseño optimizado te proporciona mayor comodidad para el juego, indispensable para largas horas de asalto o cuando estás subiendo de rango.  \n\nSWITCH ÓPTICO PARA RATÓN RAZER™  \nLos switches de este ratón ergonómico, que utilizan un haz de infrarrojos para registrar cada clic, se activan con un tiempo de respuesta de 0,2 milisegundos, tiempo líder del mercado. Al no requerir contacto físico, esta activación elimina la necesidad del retraso antirrebotes, lo que te proporciona un control aún más preciso y una ejecución perfecta.  \n\nSENSOR ÓPTICO RAZER FOCUS+  \nNuestro nuevo y mejorado sensor es el líder del mercado con sus 20 000 PPP y una precisión de resolución de un 99,6 %, que garantiza que se registre perfectamente hasta el más mínimo movimiento de tu ratón ergonómico. Equipado con funciones inteligentes, el sensor es ahora todavía más preciso, otorgándote un nivel de precisión con el que podrás acertar esos disparos ganadores.  \n\nCABLE RAZER SPEEDFLEX  \nEl cable del Razer DeathAdder V2 tiene una mayor flexibilidad y está diseñado para producir una resistencia mínima, para que puedas realizar movimientos más rápidos y suaves y lograr un mayor grado de control.  \n\nTACTO INSTINTIVO DE LA RUEDA DE DESPLAZAMIENTO  \nPerfectamente afinado para un desplazamiento preciso, con muescas y menor resistencia, para que pasar de un arma a otra o ejecutar un bunny hopping se convierta en algo natural.  \n\n8 BOTONES PROGRAMABLES  \nEl ratón cuenta con 8 botones programables que puedes configurar por completo a través de Razer Synapse 3, lo que te brinda acceso a las macros y las funciones secundarias para que ejecutes cada acción con facilidad.  \n\nBASE DEL RATÓN COMPUESTA EN UN 100 % DE TEFLÓN  \nDisfruta de un movimiento suave sobre cualquier superficie con una base fabricada con teflón más puro y de mayor calidad, un material que se usa en las sartenes antiadherentes.  \n\nMEMORIA INTEGRADA AVANZADA  \nGuarda y almacena hasta 5 configuraciones de perfiles en la memoria integrada y lleva tus ajustes donde quieras para estar siempre listo para competir con tus controles favoritos.  \n\nESPECIFICACIONES  \n\n• Sensor óptico Focus+ con 20 000 PPP reales  \n• Hasta 650 pulgadas por segundo (IPS)/50 G de aceleración/la mejor precisión de resolución de la industria con un 99,6 %  \n• Switches ópticos para ratón Razer™ con una duración de hasta 70 millones de clics  \n• Diseño ergonómico mejorado con agarres laterales de goma ultraduraderos  \n• Base del ratón grande de teflón 100 % (0,8 mm de grosor)  \n• Rueda de desplazamiento táctil especial para juegos  \n• Ajustes inmediatos de sensibilidad (niveles predeterminados: 400/800/1600/2400/3200)  \n• Almacenamiento híbrido en la nube y memoria integrada (4 perfiles +1)  \n• Iluminación Razer Chroma™ RGB con 16,8 millones de colores reales personalizables  \n• Ocho botones Hyperesponse programables de forma independiente  \n• Personalización avanzada de la distancia de elevación/apoyo  \n• Compatible con Razer Synapse 3  \n• Cable Speedflex de 2,1 m/7 pies  \n• Tamaño aproximado: 127,0 mm (largo) x 61,7 mm (ancho de agarre) x 42,7 mm (alto)  \n• Peso aproximado: 82 grs. (sin el cable)  \n• Compatible con Xbox One para entrada básica',_binary '','Razer DeathAdder V2 Negro RZ0103210100R3U1',546169.9801077548,11),('MLA16403602','',_binary '\0','Mouse gamer gamer Philips SPK9313',84209.75690953532,24),('MLA20032972','',_binary '','Mouse Razer Bungee V2',1147020.5234379773,20),('MLA20201821','Desde 2005 Razer es la marca líder de estilo de vida para jugadores. Ha diseñado y construido el ecosistema de hardware, software y servicios más grande del mundo. La ubicación de cada botón y curva de los mouses Razer se crearon para adaptarse perfectamente a tu mano. Gracias a estos dispositivos, conseguirás una experiencia de juego cómoda y placentera.\n\nAdaptado a tus movimientos\nEl mouse de juego te ofrecerá la posibilidad de marcar la diferencia y sacar ventajas en tus partidas. Su conectividad y sensor suave ayudará a que te desplaces rápido por la pantalla.\n\nLa funcionalidad al alcance de tu mano\nEl sistema de detección de movimiento óptico te permitirá mover el cursor de una manera más precisa y sensible que en los sistemas tradicionales.\n\nApto para fácil traslado\nNavegá rápidamente por documentos y páginas web gracias su diseño ultra delgado, ergonómico, liviano y conveniente para llevar a donde quieras o viajar.',_binary '','Mouse Razer Deathadder Expert Gamer Gaming Mouse',453171.89078938443,7),('MLA20540481','',_binary '','Mouse gamer gamer Gamer Tech GT3 negro',988823.1009925298,30),('MLA20934955','Para trabajar desde casa con la computadora o aprovechar los momentos de ocio, necesitas comodidad y facilidad de movimiento. Con tu Havit MS72 encuentra eso que buscas en un solo aparato con la mejor tecnología.\n\nApto para fácil traslado\nNavega rápidamente por documentos y páginas web gracias su diseño ultra delgado, ergonómico, liviano y conveniente para llevar a donde quieras o viajar.',_binary '\0','Mouse gamer Havit Gamer MS72',1196156.8426457008,23),('MLA22285785','Logitech diseña productos y experiencias que ocupan un lugar cotidiano en la vida de las personas, poniendo foco en la innovación y la calidad. Su objetivo es crear momentos verdaderamente únicos y significativos para sus usuarios. Los mouses Logitech se adaptan a la forma de tu mano para proporcionarte horas de comodidad. Sin necesidad de mover el brazo para deslizar el cursor, tu mano se fatigará menos. Son ideales para cualquier espacio de trabajo y quienes tienen la mesa llena de diversos objetos.\n\nApto para fácil traslado\nNavega rápidamente por documentos y páginas web gracias su diseño ultra delgado, ergonómico, liviano y conveniente para llevar a donde quieras o viajar.',_binary '','Mouse Logitech MOUSE Pebble M350',849115.9310600972,20),('MLA23266382','Logitech diseña productos y experiencias que ocupan un lugar cotidiano en la vida de las personas, poniendo foco en la innovación y la calidad. Su objetivo es crear momentos verdaderamente únicos y significativos para sus usuarios. Los mouses Logitech se adaptan a la forma de tu mano para proporcionarte horas de comodidad. Sin necesidad de mover el brazo para deslizar el cursor, tu mano se fatigará menos. Son ideales para cualquier espacio de trabajo y quienes tienen la mesa llena de diversos objetos.\n\nAdaptado a tus movimientos\nSu diseño eficaz hace de este mouse un elemento cómodo, con una gran experiencia de uso para aquellas personas que buscan seguridad en cada click.\n\nLa funcionalidad al alcance de tu mano\nEl sistema de detección de movimiento óptico te permitirá mover el cursor de una manera más precisa y sensible que en los sistemas tradicionales.\n\nPlug And Play\nSolo debes colocar el receptor en un puerto USB de la computadora y ya puedes empezar a usarlo. No hace falta emparejar el mouse ni descargar software para utilizarlo.\n\nApto para fácil traslado\nNavega rápidamente por documentos y páginas web gracias su diseño ultra delgado, ergonómico, liviano y conveniente para llevar a donde quieras o viajar.',_binary '','Mouse Logitech M325c Inalambrico',255321.44548698084,5),('MLA23695948','Desde 2005, Razer ha sido la marca líder de estilo de vida para jugadores. Ha diseñado y construido el ecosistema de hardware, software y servicios más grande del mundo. La ubicación de cada botón y curva de los ratones Razer se han creado para que se ajusten perfectamente a tu mano. Gracias a estos dispositivos, tendrás una experiencia de juego cómoda y agradable. \n \n Adaptado a tus movimientos \n El ratón para juegos te ofrecerá la posibilidad de marcar la diferencia y sacar provecho de tus juegos. Su conectividad y su suave sensor te ayudarán a moverte rápidamente por la pantalla. \n \n La funcionalidad al alcance de tu mano \n El sistema óptico de detección de movimiento te permitirá mover el cursor con mayor precisión y sensibilidad que los sistemas tradicionales. \n \n Adecuado para un fácil transporte \n Navega rápidamente por documentos y sitios web gracias a su diseño ultrafino, ergonómico, ligero y práctico para llevarlo a donde quieras o de viaje.',_binary '','Ratón Razer Deathadder 2013 4g 6400dpi -',1087874.8686481612,25),('MLA23700789','*******Descripción \n Desde 2005, Razer ha sido la marca líder de estilo de vida para jugadores. Ha diseñado y construido el ecosistema de hardware, software y servicios más grande del mundo. La ubicación de cada botón y curva de los ratones Razer se han creado para que se ajusten perfectamente a tu mano. Gracias a estos dispositivos, tendrás una experiencia de juego cómoda y agradable. \n \n Adaptado a tus movimientos \n Su eficaz diseño lo convierte en un ratón cómodo, con una gran experiencia de usuario para quienes buscan seguridad en cada clic. \n \n La funcionalidad al alcance de tu mano \n El sistema óptico de detección de movimiento te permitirá mover el cursor con mayor precisión y sensibilidad que los sistemas tradicionales. \n \n Adecuado para un fácil transporte \n Navega rápidamente por documentos y sitios web gracias a su diseño ultrafino, ergonómico, ligero y práctico para llevarlo a donde quieras o de viaje. \n \n Especificaciones: \n Formato: correcto \n Conectividad: cable estándar \n Duración de la batería: ninguna \n Iluminación RGB: iluminación verde monocolor \n Sensor: óptico \n Sensibilidad máxima (dpi) :6400 \n Velocidad máxima (ips) :220 \n Aceleración máxima (g) :30 \n Botones programables: 5 \n Tipo de conmutador: mecánico \n Ciclo de vida del conmutador: 10 millones de clics \n Perfiles de memoria integrados: ninguno \n Patas de ratón: patas estándar \n Cable: cable estándar (cable de plástico) \n Longitud del cable: 2,1 m/6,89 pies \n Rueda de desplazamiento inclinable: ninguna \n Tamaño aproximado: longitud: 127,0 mm/5,00 pulgadas \n Ancho: 61,7 mm/2,43 pulgadas: altura: 42,7 mm/1,68 pulgadas \n Peso aproximado: 96 g/0,211 libras \n Compatibilidad con la base: ninguna \n Interruptores mecánicos de ratón Razer con un ciclo de vida de 10 millones de clics \n Desplazamiento táctil tipo rueda de juego \n Ultrapolling 1000 hz \n Iluminación verde monocolor \n Razer synapse 3 (beta) activado \n Tamaño aproximado: 127,0 mm/5,0 pulgadas (largo) x 73,0 mm/2,90 pulgadas (ancho) x 43,0 mm/1,70 pulgadas (altura) \n Peso aproximado (sin cable): 96 g/0,211 libras \n \n Lista de paquetes: \n 1 * razer deathadder Ratón para juegos esencial con cable \n 1 * manual de usuario',_binary '','Ratón Razer Deathadder',929044.2186047565,32),('MLA24044252','Desde 2005 Razer es la marca líder de estilo de vida para jugadores. Ha diseñado y construido el ecosistema de hardware, software y servicios más grande del mundo. La ubicación de cada botón y curva de los mouses Razer se crearon para adaptarse perfectamente a tu mano. Gracias a estos dispositivos, conseguirás una experiencia de juego cómoda y placentera.\n\nLa funcionalidad al alcance de tu mano\nEl sistema de detección de movimiento óptico te permitirá mover el cursor de una manera más precisa y sensible que en los sistemas tradicionales.\n\nPlug And Play\nSolo debes colocar el receptor en un puerto USB de la computadora y ya puedes empezar a usarlo. No hace falta emparejar el mouse ni descargar software para utilizarlo.\n\nApto para fácil traslado\nNavega rápidamente por documentos y páginas web gracias su diseño ultra delgado, ergonómico, liviano y conveniente para llevar a donde quieras o viajar.',_binary '','Mouse Razer Deathadder V3 Ergonomico Color Negro',1155656.2064595667,30),('MLA24613072','Logitech diseña productos y experiencias que ocupan un lugar cotidiano en la vida de las personas, poniendo foco en la innovación y la calidad. Su objetivo es crear momentos verdaderamente únicos y significativos para sus usuarios. Los mouses Logitech se adaptan a la forma de tu mano para proporcionarte horas de comodidad. Sin necesidad de mover el brazo para deslizar el cursor, tu mano se fatigará menos. Son ideales para cualquier espacio de trabajo y quienes tienen la mesa llena de diversos objetos.\n\nApto para fácil traslado\nNavega rápidamente por documentos y páginas web gracias su diseño ultra delgado, ergonómico, liviano y conveniente para llevar a donde quieras o viajar.',_binary '\0','Mouse Logitech MOUSE peble m350 M350',281679.3454536059,15),('MLA24671004','Para trabajar desde casa con el ordenador o disfrutar del tiempo libre, necesita comodidad y facilidad de movimiento. Con tu extraordinario ratón gamer pro de A.R Variedades Mt Mouse encontrarás lo que buscas en un único dispositivo con la mejor tecnología. \n \n La funcionalidad al alcance de tu mano \n El sistema óptico de detección de movimiento te permitirá mover el cursor de una manera más precisa y sensible que los sistemas tradicionales. \n \n Adecuado para un fácil transporte \n Navega rápidamente por documentos y sitios web gracias a su diseño ultrafino, ergonómico, ligero y práctico para llevarlo a donde quieras o de viaje.',_binary '','Mouse Gamer Pro Mouse Extraordinario',393282.5251081246,12),('MLA25564493','Para trabajar desde casa con el ordenador o disfrutar del tiempo libre, necesita comodidad y facilidad de movimiento. Con tu A.R Variedades Mt Mouse gamer pro mouse gamer rgb dpi 7 botones usb encuentra lo que buscas en un solo dispositivo con la mejor tecnología. \n \n La funcionalidad al alcance de tu mano \n El sistema óptico de detección de movimiento te permitirá mover el cursor de una manera más precisa y sensible que los sistemas tradicionales. \n \n Adecuado para un fácil transporte \n Navega rápidamente por documentos y sitios web gracias a su diseño ultrafino, ergonómico, ligero y práctico para llevarlo a donde quieras o de viaje.',_binary '','Mouse Gamer Pro Mouse Gamer Rgb Dpi 7 Botes USB',280844.1677964138,16),('MLA26580853','El Mouse Razer Gamer Cobra Rgb Color Negro es el complemento perfecto para los amantes de los videojuegos. Con su diseño ergonómico y orientación para diestros, este mouse ofrece una experiencia de juego cómoda y precisa. Con su sensor óptico de 8500 dpi y una velocidad máxima de 300 ips, podrás disfrutar de movimientos rápidos y precisos en tus partidas. Además, cuenta con 6 botones programables que te permiten personalizar tus acciones y adaptar el mouse a tu estilo de juego. Compatible con sistemas operativos Windows, este mouse es ideal para cualquier gamer que busque mejorar su rendimiento. ¡No pierdas la oportunidad de llevar tu experiencia de juego al siguiente nivel con el Mouse Razer Gamer Cobra Rgb Color Negro!',_binary '','Mouse Razer Gamer Cobra Rgb Color Negro',289249.819448814,29),('MLA26801041','El Cable USB para Ratón Razer Deathadder es el accesorio perfecto para potenciar tu experiencia de juego. Con su diseño de alta calidad y su conexión por cable, garantiza una conexión estable y sin retrasos, permitiéndote disfrutar al máximo de tus partidas. Su color negro elegante y su marca genérica aseguran una combinación perfecta con cualquier estilo de escritorio. Además, su modelo 4330128571 y su MPN 4330128571 garantizan su compatibilidad con una amplia gama de ratones. No pierdas más tiempo buscando cables que no cumplen tus expectativas, el Cable USB para Ratón Razer Deathadder es la elección ideal para los gamers más exigentes.',_binary '\0','Cable Usb Para Raton Razer Deathadder',601865.6570298548,20),('MLA26994480','Optimiza tus tareas de limpieza con esta hidrolavadora TRENT, combinando potencia y seguridad en un diseño eficiente.\n\nCARACTERÍSTICAS:\n\n• Potencia: 1400W.\n• Presión máxima: 1600 psi - 110 bar.\n• Caudal máximo: 6.5 L/min.\n• Rendimiento de limpieza de 20 a 40 m2/h.\n• Tecnología AutoStop para mayor seguridad y eficiencia.\n• Motor: Tres Pistones de acero inoxidable.\n• Temperatura máxima agua entrante: 50° C.\n• Nivel de ruido: 92 dB(A).\n• Alimentación: 220V ~ 50 Hz\n• Clase de protección: IPX5\n• Protección eléctrica Clase II (doble aislamiento) y certificación por el organismo LENOR.\n\nINCLUYE:\n\n• Pistola de alta presión con Lanza ajustable.\n• Botella de detergente.\n• Manguera de alta presión de 5 metros.\n• Cable de conexión de 5 metros.\n• Soportes.\n• Filtro de entrada.\n• Pin limpiador de boquilla.\n• Conector rápido de Manguera estándar 1/2¨pulgada\" hacia la Hidrolavadora (No incluye conector de manguera a grifo)\n\nNota: El producto no incluye manguera de entrada de agua, depósito interno de agua ni detergente. La lanza no es telescópica y el producto no es sumergible en agua, se debe utilizar solo con agua corriente de grifo.\n\n¡Transforma tu limpieza hoy!',_binary '','Hidrolavadora Electrica Trent HLT203 1400W Alta presion 1600 Psi 110 Bar con Accesorios',910480.7969500392,31),('MLA27147200','*** CARACTERÍSTICAS DEL PRODUCTO ***\n\nMARCA: Razer\nMODELO: COBRA\n\nRAZER COBRA\nPERFECCIONADO PARA JUGAR\nRompe la marca de la precisión y la inmersión con el Razer Cobra, un ratón gaming ligero con cable y con tecnología Razer Chroma RGB. Equipado con switches ultraduraderos y una iluminación Chroma con retroiluminación personalizable, alucinarás con el increíble rendimiento que ofrece un ratón tan pequeño.\n\nDISEÑO LIGERO DE 58 G\nDeslizamientos rápidos y control cómodo\nGracias a su diseño ligero apto para la mayoría de los estilos de agarre, el Razer Cobra no solo permite un control rápido y preciso, sino que resulta supercómodo de usar incluso durante horas y horas de juego.\n\nILUMINACIÓN CHROMA CON ILUMINACIÓN INFERIOR PERSONALIZABLE\nCon tecnología Razer Chroma™ RGB\nPersonaliza el Razer Cobra con cerca de 16,8 millones de colores e innumerables efectos de iluminación. Experimenta una mayor inmersión con un ratón gaming RGB que reacciona dinámicamente con cientos de juegos con Chroma integrado.\n\nDISEÑADO PARA RENDIR\n* SWITCHES\nSWITCHES ÓPTICOS PARA RATÓN RAZER™ DE 3ª GENERACIÓN\nDurabilidad y velocidad inigualables\nCon un ciclo de vida mejorado de 90 millones de clics sin problemas de doble clic, además de un funcionamiento vertiginoso de 0,2 ms sin desactivación de rebote, disfruta de una fiabilidad y velocidad que superan a todas las demás.\n\nSENSOR\nAJUSTES PRECISOS DEL SENSOR\nGracias al sensor óptico Razer™ de 8500 PPP\nAjusta la sensibilidad del Razer Cobra con ajustes precisos a intervalos de 50 PPP. Consigue la configuración perfecta que se ajuste de verdad a tu estilo de juego.\n\nCABLE SPEEDFLEX\nRAZER™ CABLE SPEEDFLEX\nMovimiento suave y fluido del ratón\nEl cable del Razer Cobra tiene una mayor flexibilidad y está diseñado para producir una resistencia mínima, de manera que puedas realizar movimientos más rápidos y fluidos, y lograr así un mayor control.\n\nFUNCIONES MÁS AVANZADAS\n100% PTFE BASE DEL RATÓN\nFabricada con el PTFE más puro y de mejor calidad, la base de ratón del Razer Cobra de la parte frontal, trasera y el anillo del sensor le permite deslizarse de forma fluida por cualquier superficie.\n\nPERFIL DE MEMORIA INTEGRADO\nPrepárate para jugar en cualquier lugar con acceso a tu último perfil Razer Synapse utilizado, incluidos los ajustes de PPP personalizados, la configuración de los botones y mucho más.\n\nESPECIFICACIONES TÉCNICAS\nFACTOR DE FORMA: Simétrico para diestros\nCONECTIVIDAD: Con cable - Cable Razer™ Speedflex\nDURACIÓN DE LA BATERÍA: Ninguna\nILUMINACIÓN RGB: Razer Chroma™ RGB\nSENSOR: Optischer Sensor mit 8500 DPI\nSENSIBILIDAD MÁXIMA (PPP): 8500\nVELOCIDAD MÁXIMA (IPS): 300\nACELERACIÓN MÁXIMA (G): 35\nBOTONES PROGRAMABLES: 6\nTIPO DE SWITCH: Switches ópticos para ratón de 3.ª generación\nCICLO DE VIDA DEL SWITCH: 90 millones de clicks\nMEMORIA INTEGRATO: 1\nBASE DEL RATÓN: 100% PTFE\nCABLE: Cable Razer™ Speedflex\nRUEDA INCLINABLE: Ninguna\nDIMENSIONES:\n- Largo: 119,6 mm\n- Ancho: 62,5 mm\n- Alto: 38,1 mm\nPESO APROXIMADO: 58 gramos (sin incluir el cable)\nCOMPATIBILIDAD DE PUERTO: Ninguna\nBOX CONTENTS:\n- Razer Cobra\n- Guía de información importante del producto',_binary '','Mouse Razer Cobra Lightweight Chroma Rgb',1034505.0827885801,12),('MLA27831183','Skates Feet Skatez Foot para Razer DeathAdder Mouse \n \n Reduce la fricción entre el ratón y la alfombrilla provocada por el movimiento, proporcionando la sensación de un ratón recién comprado. \n \n Compatible con: \n \n Razer Deathadder \n Razer Deathadder 2012 \n Razer Deathadder 2013 \n Razer Deathadder 3.5G \n Razer Deathadder Chroma \n \n Juego de 3 piezas en la parte superior, inferior y central. \n \n Nota: Quita las patas viejas del ratón con cuidado. Limpia el lugar. Evite tocarlas antes de pegarlas, para no dejar marcas de sudor o manchas de aceite en las nuevas patas de ratón. Pega los patines con firmeza en el lugar correspondiente. Presiona los patines durante unos 30 segundos para asegurar la fijación.',_binary '\0','Patines Feet Foot para Razer Deathadder',967754.498664988,30),('MLA28158726','La pieza Scroll Razer Deathadder 2013 Color Black es una pieza de repuesto perfecta para tu ratón Razer DeathAdder. Esta pieza es compatible con los modelos Razer Deathadder, Razer Deathadder Chroma y Razer Deathadder 3.5g de 2013. \n \n Fabricada por Casa do Periferico, una marca conocida por su calidad y durabilidad, esta pieza es la solución ideal para mantener tu ratón Razer en perfectas condiciones. El color negro de la pieza combina perfectamente con el diseño elegante y sofisticado de los ratones Razer DeathAdder. \n \n Este Scroll cuenta con un sensor Razer, reconocido por su precisión y velocidad, que mejorará tu experiencia de juego o laboral. Además, la pieza viene con una rueda de desplazamiento, lo que permite una navegación fluida y eficiente. \n \n A pesar de no tener Bluetooth, esta pieza es fácil de instalar gracias a su diseño cableado. Así que no te preocupes si tu ratón Razer DeathAdder deja de funcionar, con la parte Razer Deathadder Scroll 2013 Color Black, podrás volver a utilizar tu ratón como si fuera nuevo.',_binary '','Razer Deathadder Scroll Part 2013, color negro',250884.31318780078,4),('MLA28174098','Skates Feet Skatez Foot para Razer DeathAdder v2 Mouse \n \n Reduce la fricción entre el ratón y la alfombrilla provocada por el movimiento, proporcionando la sensación de un ratón recién comprado. \n \n Juego de 3 piezas: parte superior, inferior y central. \n \n Nota: Quita la pata del ratón viejo con cuidado. Limpia la zona. Evite tocarlas antes de pegarlas, para no dejar marcas de sudor o manchas de aceite en la nueva pata del ratón. Coloque las patas del ratón firmemente en el lugar correspondiente. Presione los pies del ratón durante unos 30 segundos para garantizar la fijación.',_binary '\0','Pie para ratón Razer Deathadder V2',77183.46600687428,16),('MLA34226398','Desde 2005 Razer es la marca líder de estilo de vida para jugadores. Ha diseñado y construido el ecosistema de hardware, software y servicios más grande del mundo. La ubicación de cada botón y curva de los mouses Razer se crearon para adaptarse perfectamente a tu mano. Gracias a estos dispositivos, conseguirás una experiencia de juego cómoda y placentera.\n\nApto para fácil traslado\nNavega rápidamente por documentos y páginas web gracias su diseño ultra delgado, ergonómico, liviano y conveniente para llevar a donde quieras o viajar.',_binary '','Mouse Razer Dock Pro Rgb Color Negro',137026.14696317178,11),('MLA34239468','Desde 2005, Razer ha sido la marca líder de estilo de vida para jugadores. Ha diseñado y construido el ecosistema de hardware, software y servicios más grande del mundo. La ubicación de cada botón y curva de los ratones Razer se han creado para que se ajusten perfectamente a tu mano. Gracias a estos dispositivos, tendrás una experiencia de juego cómoda y agradable. \n \n Adecuado para un fácil transporte \n Navega rápidamente por documentos y sitios web gracias a su diseño ultrafino, ergonómico, ligero y cómodo para llevarlo a donde quieras o de viaje.',_binary '','Ratón Razer Deathadder V3 Deathadder V3 Negro',228333.67588867288,8),('MLA36037221','',_binary '','Base Carga Mouse Razer Con Razer G Pro X Superlight Ratones',910929.8741009361,24),('MLA36258543','Mouse Logitech  \n\nLogitech M190 es un mouse inalámbrico de gran tamaño con un contorno que sigue la curva natural de las manos medianas y grandes. Comodidad durante todo el día gracias al soporte arqueado de la palma y al botón especial para una colocación ideal de los dedos.\n\nTrabajará de forma inalámbrica y se moverá libremente, desde una distancia de hasta 10 metros*, prácticamente sin retrasos ni interrupciones. Sin cables que no hay desorden en su escritorio. La duración de la batería es de 18 meses* y cuenta con un modo de ahorro de energía que se activa automáticamente cuando no está usando el mouse.\n\nObtendrá una gran calidad con seguimiento de precisión y desplazamiento línea por línea a un precio asequible.\n\n*El alcance inalámbrico y la duración de la batería pueden variar según el usuario, las condiciones ambientales y de computación.\n\n• COMODIDAD DE GRAN TAMAÑO: comodidad óptima para cualquier mano con una forma contorneada para seguir la curva natural de las manos grandes. Los botones en forma de pala guían los dedos a una ubicación ideal.\n• CONEXIÓN INALÁMBRICA SIN LAG: trabaje de forma inalámbrica y muévase libremente, desde una distancia de hasta 10 metros, prácticamente sin demoras ni interrupciones. Sin cables que no hay desorden en su escritorio y es fácil de transportar.\n• CALIDAD SIN COMPROMISOS: obtenga una gran calidad con seguimiento de precisión y desplazamiento preciso línea por línea a un precio asequible. Más fácil sin molestos clics perdidos.\n• CONSTRUIDO PARA DURAR: calidad duradera y confiable del líder mundial en mouse y teclados. Un mouse de computadora de todos los días en el que puede confiar durante más tiempo.\n• DURACIÓN DE LA BATERÍA DE 18 MESES: disfrute de meses de uso sin preocupaciones. El modo de ahorro de energía se activa automáticamente cuando no está usando el mouse. Batería AA incluida.\n\nColor: gris medio.   \nMarca: Logitech  \nDimensiones: 0.18 x 0.11 x 0.09 mts.  \nPeso del Producto: 0.14 Kilogramos.  \nPeso de Envío: 0.14 Kilogramos.  \nModelo:  \nRef: B087Z6P16M',_binary '','Mouse Logitech Inalambrico/gris',850348.3499395899,23),('MLA36496502','Logitech diseña productos y experiencias que ocupan un lugar cotidiano en la vida de las personas, centrándose en la innovación y la calidad. Su objetivo es crear momentos verdaderamente únicos y significativos para sus usuarios. Los ratones Logitech se adaptan a la forma de la mano para proporcionarte horas de comodidad. Sin tener que mover el brazo para deslizar el cursor, la mano se cansará menos. Son ideales para cualquier espacio de trabajo y para aquellos cuyo escritorio está lleno de diversos objetos. \n \n Adecuado para un fácil transporte \n Navega rápidamente por documentos y sitios web gracias a su diseño ultrafino, ergonómico, ligero y práctico para llevarlo a donde quieras o de viaje.',_binary '','Mouse Logitech M90 Usb',1089219.0649750605,11),('MLA36546336','BT.L Agarre mouse Logitech G305, Logitech G203 y Logitech PRO Gaming (negro plátano)   \n\n•  Cortado para adaptarse a Logitech G305, Logitech G203, Logitech PRO GAMING  \n•  5 piezas de cinta de agarre (botones principales 1-2, lados izquierdo-derecho, lado trasero)  \n•  Diseño delgado con un espesor de sólo 0,5 mm (0,019 pulgadas)  \n•  Material polimérico cómodo y antideslizante de alta calidad  \n•  Adhesivo FÁCIL DE 3M fuerte y duradero, seguro para su mouse  \n\nColor:  Plátano negro.     \n  \nMarca: BT.L  \nDimensiones: 0.12 x 0.12 x 0.01 mts.  \nPeso del Producto: 0.01 Kilogramos.  \nPeso de Envío: 0.01 Kilogramos.  \nModelo: BMGLG305   \n  \nRef: B0BQX55XRC',_binary '\0','Bt.l Agarre Mouse Logitech G305, Logitech G203 Y Logitech',507148.7987844464,32),('MLA36553131','Mouse Logitech M305  \n\nLogitech Wireless Mouse M305 ofrece una comodidad excepcional y conveniencia inalámbrica con su empuñadura de goma ergonómicamente suave y el Nano-receptor Plug-and-Forget.  \n\n• Logitech Wireless Laser Mouse M305 Características generales: Color plateado y negro Inalámbrico  \n• Tecnología óptica Cómoda, ergonómica Rueda de desplazamiento de 3 botones Contorneada  \n• Empuñaduras laterales suaves Incluye un transceptor Logitech Nano Funciona con una batería AA (no incluida)  \n• Hasta dos años de duración de la batería Dimensiones de la unidad: 1,5 x 2,4 x 4,5 pulgadas (alto x ancho x profundidad)  \n• Color: plata.  \n• Marca: Logitech  \n• Dimensiones: 0.21 x 0.14 x 0.06 mts.  \n• Peso del Producto: 0.14 Kilogramos.  \n• Peso de Envio: 0.14 Kilogramos.  \n• Modelo:  \n• Ref: B002Y6CJJ8',_binary '\0','Mouse Logitech B002y6cjj8 Plata.',415863.0226665514,9),('MLA36612441','Cinta antideslizante para mouse Razer Viper Ultimate, mouse inalámbrico para juegos más liviano   \n\nApto para el ratón inalámbrico para juegos Razer Viper Ultimate más ligero y el ratón para juegos con cable ambidiestro ultraligero Razer Viper SOLAMENTE   \n\n• Viene con 1 juego   \n\nColor: Para Viper inalámbrico y cableado.     \n\nMarca: PZZIFA  \nDimensiones: 0.12 x 0.11 x 0.01 mts.  \nPeso del Producto: 0.02 Kilogramo