 PLÁSTICO RECICLADO.  \nHECHO PARA DURAR.  \nLas piezas de plástico del mouse M196 incluyen plástico reciclado posconsumo con certificación. (67% para grafito y 66% para blanco crudo y rosado).\n\nNAVEGACIÓN SENCILLA, CONTROL PRECISO  \nGracias al desplazamiento controlado línea a línea y al seguimiento óptico, el mouse M196 ofrece un control del cursor fluido y preciso en casi cualquier superficie.\n\nCALIDAD EN LA QUE PUEDES CONFIAR  \n12 meses de duración de baterías y la suspensión automática te ayudan a pasar más tiempo entre cambios de baterías AA.\n\nESPECIFICACIONES\n\nAltura: 100 mm  \nAnchura: 60 mm  \nProfundidad: 38 mm  \nPeso (con baterías): 76 g  \nTecnología de sensor  \nSeguimiento óptico uniforme: 1000 DPI  \nDesplazamiento línea por línea  \nRueda de desplazamiento: 2D, mecánico  \nDetalles de batería  \nDuración de baterías: 12 meses  \nTipo de conexión: Tecnología Bluetooth Low Energy  \nRadio de acción inalámbrico: 10 m  \nConexión/Alimentación: interruptor de ENCENDIDO/APAGADO, modo de emparejamiento con pulsación larga  \nDispositivos compatibles  \nWindows 10, 11 o posteriores  \nmacOS 11 o posteriores  \nEn la caja  \nMouse  \nUna batería AA (preinstalada)  \nDocumentación del usuario',_binary '','Mouse Logitech M196 grafito',524720.0452871034,32),('MLA45902920','El mouse M280 te permite afrontar los desafíos del día con un nuevo grado de comodidad. El agarre curvo y estampado se adapta de forma natural a la mano mientras hace el seguimiento y se desplaza con excelente precisión. La batería de larga duración, la amplia compatibilidad y la sólida conexión inalámbrica aseguran una alta confiabilidad y facilidad de uso.',_binary '','Mouse Logitech M280 Wireless Mouse Gris',764262.6047511813,13),('MLA46344370','Este componente electrónico procesa la información que llega al dispositivo y los transforma en imágenes o videos para mostrarla visualmente. Es ideal para trabajar con aplicaciones gráficas ya que permite obtener imágenes más nítidas.\